import Header from './Header';
import Footer from './Footer';
import Head from 'next/head';

export default ({ children, title='Nextconf' }) => (
    <div>
        <Head>
          <title>{title}</title>
          <link rel="stylesheet" href="nprogress.css" />
          <link rel="stylesheet" href="styles.css" />
        </Head>
        <Header />
          {children}
        <Footer />
    </div>
)
